import axios from "axios";

function App() {
  const sendEvent = async (type) => {
    await axios.post("http://localhost:5000/event", {
      userId: "u1",
      eventType: type
    });
  };

  return (
    <div style={{ padding: 30 }}>
      <h2>Event Logger</h2>
      <button onClick={() => sendEvent("START")}>Start</button>
      <button onClick={() => sendEvent("SWITCH")}>Switch</button>
      <button onClick={() => sendEvent("STOP")}>Stop</button>
    </div>
  );
}

export default App;
